<urn:markdown:Bildungsroman:work:Plato%20-%20The%20Republic%20Book%20IV%20Section%20III> a paradicms:Work;
    dcterms:license <http://creativecommons.org/publicdomain/mark/1.0/>;
    dcterms:source <http://www.gutenberg.org/files/1497/1497-h/1497-h.htm#link2H_4_0007>;
    dcterms:relation <http://www.wikidata.org/entity/Q123397>, <http://en.wikipedia.org/wiki/Republic_(Plato)>;
    dcterms:title "Plato - The Republic Book IV Section III";
    paradicms:institution <urn:markdown:Bildungsroman:institution:default>;
    dcterms:creator <urn:markdown:Bildungsroman:person:Plato>;
    paradicms:collection <urn:markdown:Bildungsroman:collection:Passion>;
    dcterms:abstract "<blockquote>\n<p>But a further question arises: Is passion different from reason also, or only a kind of reason; in which latter case, instead of three principles in the soul, there will only be two, the rational and the concupiscent; or rather, as the State was composed of three classes, traders, auxiliaries, counsellors, so may there not be in the individual soul a third element which is passion or spirit, and when not corrupted by bad education is the natural auxiliary of reason?</p>\n<p>Yes, he said, there must be a third.</p>\n<p>Yes, I replied, if passion, which has already been shown to be different from desire, turn out also to be different from reason.</p>\n<p>But that is easily proved: We may observe even in young children that they are full of spirit almost as soon as they are born, whereas some of them never seem to attain to the use of reason, and most of them late enough.</p>\n</blockquote>";
    dcterms:bibliographicCitation "Plato. The Republic of Plato. Translated by Benjamin Jowett, Henry Frowde - Oxford University Press, 1888."
}
